import { ButtonPink } from "../ButtonsPink";
import logo from "../../assets/Nu Kenzie.svg";
import profile from "../../assets/illustration.svg";
import "./style.css";

export const PageLogin = ({ isLoggedIn, verification }) => {
  return (
    <div className="flex">
      <section className="flex">
        <img src={logo} className="logo" alt="" />
        <h1 className="title-1">Centralize o controle das suas finanças</h1>
        <span className="span-1">de forma rápida e segura</span>
        <ButtonPink verification={verification} />
      </section>
      <section>
        <img src={profile} alt="" />
      </section>
    </div>
  );
};
